USE MASTER;

-- Create database named music
CREATE DATABASE music;
GO

-- Use the database music
USE music;

-- Create table named album
CREATE TABLE album(
	albumID		INT			IDENTITY(1,1)	,
	position	INT			NOT NULL		,
	year		INT							,
	name		VARCHAR(70) NOT NULL		,
	artist		VARCHAR(60) NOT NULL		,
	genre		VARCHAR(20) NOT NULL		,
	subgenre	VARCHAR(20)
);

-- Add primary key (albumID) to table album
ALTER TABLE album
ADD CONSTRAINT PK_albumID
PRIMARY KEY (albumID);

